// src/components/Sidebar.jsx
import { Home, Users, Clock } from "lucide-react";
import { Link } from "react-router-dom";

export default function Sidebar() {
  return (
    <aside className="w-64 h-screen bg-blue-950 text-white flex flex-col p-4">
      <h2 className="text-2xl font-bold mb-6">Panel Admin</h2>
      <nav className="flex flex-col gap-3">
        <Link to="/admin" className="flex items-center gap-2 hover:bg-blue-800 p-2 rounded">
          <Home size={18} /> Dashboard
        </Link>
        <Link to="/admin/users" className="flex items-center gap-2 hover:bg-blue-800 p-2 rounded">
          <Users size={18} /> Usuarios
        </Link>
        <Link to="/admin/asistencias" className="flex items-center gap-2 hover:bg-blue-800 p-2 rounded">
          <Clock size={18} /> Asistencias
        </Link>
      </nav>
    </aside>
  );
}
